import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import HomeCover                from './../../components/CoverPage/HomeCover';
import ContainerBlocksVantages  from './../../components/Contents/ContainerBlocksVantages';

class Home extends Component {
  render() {
    return (
      <div>

        <Header />

          <HomeCover />
          <ContainerBlocksVantages />

          <div data-container-personal-depoiment className="bg-colored">

            <div className="container-page">

              <div data-card-personal-depoiment>
                <div data-header-card>
                  <i data-avatar>
                    <i>a</i>
                  </i>
                  <p data-name>Felipe Oliveira</p>
                </div>
                <div data-description>
                  asodij asiod jasfiodsfioj adsofij adsiofjadsofiadjfiojadfiodiof dofij dsiof dsiof dsiof dsiof dsiof doif dsiof dsio
                </div>
              </div>

            </div>

          </div>

        <Footer />

      </div>
    );
  }
}
export default Home;
